import {Row} from 'react-bootstrap'
import React from 'react'

class Task extends React.Component {
    constructor() {
        super()
        this.state = {
            "task":"",
            "isDone":false
        }
    }

    render() {
      return (
          <Row>
              <h1>{this.props.dataFromParent.task}</h1>
              <h1>{ this.props.dataFromParent.isDone}</h1>
          </Row>
      );
    }
  }

  export default Task;
